import React from 'react';

const Card = (name, email, id) => {
	return (
		<div className='tc bg-light-blue dib br3 pa3 ma2 grow bw5 shadow-5'>
			<h1>{name}</h1>
			<h2>{email}</h2>

		</div>

	);

}





export default Card;
